import styled from "styled-components";

export default function PaginaLogin() {
    return(
        <>
        <Login>
            <span>MyWallet</span>
            <input placeholder="E-mail"></input>
            <input placeholder="Senha"></input>
            <div>
                <span>Entrar</span>
            </div>
            <h3>Primeira vez? Cadastre-se</h3>
        </Login>
        </>
    );
}

const Login = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    > span{
        font-size: 32px;
        color: #FFFFFF;
        font-family: 'Saira Stencil One';
        margin-bottom: 30px;
    }
    input {
        width: 326px;
        height: 58px;
        border: 1px solid;
        border-radius: 5px;
        margin-bottom: 15px;
        background-color: #FFFFFF;
        font-size: 20px;
        padding-left: 10px;
        color: #000000;
    }
    div {
        width: 326px;
        height: 46px;
        background-color: #A328D6;
        display: flex;
        justify-content: center;
        align-items: center;
        color: #FFFFFF;
        font-weight: bold;
        font-size: 20px;
        font-family: 'Raleway';
        border-radius: 5px;
        margin-bottom: 30px;
    }
    h3 {
        font-family: 'Raleway';
        font-size: 15px;

        color: #FFFFFF;
    }

`;
